sys_variable_value.value:
(function execute(inputs, outputs) {
    var vpc = new GoogleVPCUtils();
    vpc.validateInputVariables(inputs, outputs);
    vpc.validateMandatoryVariables(inputs, ['name', 'projectid']);
    vpc.maptoOutputFromInput(inputs, outputs, ['projectid']);
    var requestbody = {
        'name': inputs.name.toLowerCase(),
        'description': inputs.description,
        'autoCreateSubnetworks': true
    };
    if (inputs.IPv4Range)
        requestbody.IPv4Range = inputs.IPv4Range;
    if (inputs.gatewayIPv4)
        requestbody.gatewayIPv4 = inputs.gatewayIPv4;
    outputs.requestbody = JSON.stringify(requestbody);
})(inputs, outputs);

